import React, {Component} from 'react';
import { FlatList, StyleSheet, View } from 'react-native';
import ForecastCard from '../ForecastCard';
import Icon from 'react-native-vector-icons/FontAwesome';

const iconButtn = <Icon.Button name="refresh" style={{backgroundColor:"#80a4e4",fontSize:"10"}}></Icon.Button>
export default class ForecastList extends Component {


    constructor(props){
        super(props);
      }
      refreshFunction () {
          console.log("55555555")
        this.props.onPress?.();
      }

    
render() {
  return (
    <View>
         <button style={{backgroundColor: "#80a4e4", width: "46"}} onPress={this.refreshFunction()}>{iconButtn}</button>
    </View>
  );
}
}

const styles = StyleSheet.create({
  card:{
    height: 200,
    backgroundColor:'rgba(56, 172, 236, 1)',
    borderWidth:0,
    borderRadius:20
}
});
